package service

import (
	"fmt"
	"testing"

	"github.com/doutorfinancas/pun-sho/api/request"
	"github.com/stretchr/testify/assert"
)

func TestQRCodeService_Generate(t *testing.T) {
	type fields struct {
		logo string
	}
	type args struct {
		qr   *request.QRCode
		link string
	}
	tests := []struct {
		name    string
		fields  fields
		args    args
		want    string
		wantErr assert.ErrorAssertionFunc
	}{
		{
			name: "generate correctly qr code",
			fields: fields{
				logo: "../img/logo_df.png",
			},
			args: args{
				qr: &request.QRCode{
					Create:      true,
					Width:       25,
					BorderWidth: 25,
					FgColor:     "#654321",
					BgColor:     "#123456",
					Shape:       "circle",
				},
				link: "https://pevides.pt/teste",
			},
			want:    "data:image/png;base64,",
			wantErr: assert.NoError,
		},
	}
	for _, tt := range tests {
		t.Run(
			tt.name, func(t *testing.T) {
				q := NewQRCodeService(tt.fields.logo)
				got, err := q.Generate(tt.args.qr, tt.args.link)
				if !tt.wantErr(t, err, fmt.Sprintf("Generate(%v, %v)", tt.args.qr, tt.args.link)) {
					return
				}
				assert.Equalf(t, tt.want, got, "Generate(%v, %v)", tt.args.qr, tt.args.link)
			})
	}
}
